    /**
     * This is the test that sequence in which elements are added has no impact on final estimates
     * ConservativeAddSketch class had this issue and hence this test
     */
    @Test
    public void testDeterministiRcEstimates() {
        List<String> lst = getDeterministicDataSet();

        Collections.shuffle(lst);
        TopElementsHistogram<String> h1 = new TopElementsHistogram<>(0.02, 0.0001, 0.9999, 5);
        for(String entry: lst){
            String[] e = entry.split(":");
            h1.add(e[0], Long.valueOf(e[1]));
        }

        Collections.shuffle(lst);
        TopElementsHistogram<String> h2 = new TopElementsHistogram<>(0.02, 0.0001, 0.9999, 5);
        for(String entry: lst){
            String[] e = entry.split(":");
            h2.add(e[0], Long.valueOf(e[1]));
        }

        Collections.shuffle(lst);
        for(String entry: lst){
            String[] e = entry.split(":");
            assertEquals(h1.estimateCount(e[0]), h2.estimateCount(e[0]));
            assertEquals(h1.estimateMeanCount(e[0]), h2.estimateMeanCount(e[0]));
        }
        System.out.println(h1.getTopElements());
        System.out.println(h2.getTopElements());
        assertEquals(h1.getTopElements(), h2.getTopElements());
    }


    @Test
    public void testMerge() {
        List<String> lst = getDeterministicDataSet();
        Collections.shuffle(lst);
        TopElementsHistogram<String> h1 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        TopElementsHistogram<String> h2 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        TopElementsHistogram<String> h3 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        TopElementsHistogram<String> h4 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        for(int i=0; i<lst.size(); i+=4){
            String[] e = lst.get(i).split(":");
            h1.add(e[0], Long.valueOf(e[1]));
            e = lst.get(i+1).split(":");
            h2.add(e[0], Long.valueOf(e[1]));
            e = lst.get(i+2).split(":");
            h3.add(e[0], Long.valueOf(e[1]));
            e = lst.get(i+3).split(":");
            h4.add(e[0], Long.valueOf(e[1]));
        }
        TopElementsHistogram<String> hf1 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        TopElementsHistogram<String> hf2 = new TopElementsHistogram<String>(0.02, 0.0001, 0.9999, 5);
        hf1.merge(h1,h2,h3,h4);
        hf2.merge(h2,h3,h1,h4);
        System.out.println(hf1.getTopElements());
        System.out.println(hf2.getTopElements());
        assertEquals(hf1.getTopElements(), hf2.getTopElements());
    }


    @Test
    public void testBigSet() {
        TopElementsHistogram<String> histogram = new TopElementsHistogram<>(0.02, 0.0001, 0.9999, 5);
        List<String> arrEntries = getDeterministicDataSet();
        for(String entry: arrEntries){
            String[] e = entry.split(":");
            histogram.add(e[0], Long.valueOf(e[1]));
        }
        System.out.println("5201:" + histogram.estimateCount("5201") + " | 8819:" + histogram.estimateCount("8819") + " | 9432:" + histogram.estimateCount("9432") +" | 3247:" + histogram.estimateCount("3247"));
        System.out.println("5201:" + histogram.estimateMeanCount("5201") + " | 8819:" + histogram.estimateMeanCount("8819") + " | 9432:" + histogram.estimateMeanCount("9432") +" | 3247:" + histogram.estimateMeanCount("3247"));
        System.out.println(histogram.getTopElements());
        assertEquals(histogram.getTopElements(), ImmutableMap.of("5201",40L, "8819",40L, "9432",40L, "3247",40L));
    }


    @Test
    public void testFalsePositive(){
        TopElementsHistogram<String> histogram = new TopElementsHistogram<String>(1.5, 0.01, 0.99, 1);
        histogram.add("a", 2);
        histogram.add("b", 3);
        histogram.add("c", 5);

        for(int i=0; i<190; i++){
            String s= RandomStringUtils.randomAlphabetic(5);
            histogram.add(s);
        }

        assertEquals(histogram.getRowsProcessed(), 200);
        assertNull(histogram.getTopElements().get("a"));  //a should not make it to top elements
        assertEquals((long)histogram.getTopElements().get("b"), 3);
        assertEquals((long)histogram.getTopElements().get("c"), 5);
    }

    @Test
    public void testSerialize(){
        TopElementsHistogram<Character> in = new TopElementsHistogram<Character>(5, 0.01, 0.99, 1);
        populate_0(in);
        TopElementsHistogram<Character> out = new TopElementsHistogram(in.serialize());
        System.out.println(in.getTopElements().toString());
        System.out.println(out.getTopElements().toString());
        //TODO why assert fails when "toString" is removed?
        assertEquals(in.getTopElements().toString(), out.getTopElements().toString());
    }
